import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Divider from '@material-ui/core/Divider';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import NativeSelect from '@material-ui/core/NativeSelect';
import InputLabel from '@material-ui/core/InputLabel';
import {Dialog} from 'primereact/dialog';


const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      maxWidth: 360,
      backgroundColor: theme.palette.background.paper,
    },
    chip: {
      margin: theme.spacing(0.5),
    },
    section1: {
      margin: theme.spacing(3, 2),
    },
    section2: {
      margin: theme.spacing(2),
    },
    section3: {
      margin: theme.spacing(3, 1, 1),
    },
    formControl: {
        minWidth: 200,
      },
      selectEmpty: {
        marginTop: theme.spacing(2),
      },
}));



export default function Menu(){
    const classes = useStyles();
    const [state, setState] = React.useState({
        age: '',
        name: 'hai',
    });

    const onClick=(name, position)=> {
        let state = {
            [`${name}`]: true
        };

        if (position) {
            state = {
                ...state,
                position
            }
        }

        this.setState(state);
    };

    const onHide = (name) => {
        this.setState({
            [`${name}`]: false
        });
    };


    const handleChange = (event) => {
        const name = event.target.name;
        setState({
        ...state,
        [name]: event.target.value,
        });
    };
    const footer = (
        <div>
            <Button label="Yes" icon="pi pi-check" onClick={onHide} />
            <Button label="No" icon="pi pi-times" onClick={onHide} />
        </div>
    );
    
    const myIcon = (
        <button className="p-dialog-titlebar-icon p-link">
            <span className="pi pi-search"></span>
        </button>
    );

    const Formu = (
        <Dialog header="Header Text" footer={footer} iconsTemplate={myIcon} visible={state.visible} style={{width: '50vw'}} modal={true} onHide={onHide}>
            The story begins as Don Vito Corleone, the head of a New York Mafia family, oversees his daughter's wedding.
            His beloved son Michael has just come home from the war, but does not intend to become part of his father's business.
            Through Michael's life the nature of the family business becomes clear. The business of the family is just like the head of the family,
            kind and benevolent to those who give respect, but given to ruthless violence whenever anything stands against the good of the family.
        </Dialog>
    );
    

    return(
        <div className={classes.root}>
            <div className={classes.section1}>
                <Grid container alignItems="center" spacing={3}>
                    <Grid item xs={12}>
                        <InputLabel htmlFor="outlined-age-native-simple">Fideicomiso</InputLabel>
                        <TextField id="paramIdFideicomiso"  defaultValue="0000" variant="outlined"/>
                    </Grid>
                    <Grid item xs={12}>
                        <InputLabel htmlFor="paramSubfiso">Sub Fiso</InputLabel>
                        <TextField id="paramSubfiso" defaultValue="0000" variant="outlined"/>
                    </Grid>
                    <Grid item xs={12}>
                    <FormControl variant="outlined" className={classes.formControl}>
                        <InputLabel htmlFor="tipoBien">Tipo de Bien</InputLabel>
                        <Select
                            native
                            value={state.age}
                            onChange={handleChange}
                            label="Age"
                            inputProps={{
                                name: 'age',
                                id: 'tipoBien',
                            }}
                        >
                            <option aria-label="None" value="" />
                            <option value={10}>Ten</option>
                            <option value={20}>Twenty</option>
                            <option value={30}>Thirty</option>
                        </Select>
                    </FormControl>
                    </Grid>
                    <Grid item xs={12}>
                        <InputLabel htmlFor="paramDescripcion">Descripcion</InputLabel>
                        <TextField id="paramDescripcion" defaultValue="Descripcion del Bien" variant="outlined"/>
                    </Grid>
                </Grid>
            </div>
            <Divider variant="middle" flexItem="true"/>
            <div className={classes.section2}>
                <ButtonGroup variant="contained" color="primary" aria-label="contained primary button group">
                    <Button>Buscar datos</Button>
                    <Button>Alta</Button>
                    <Button>Modificaci√≥n</Button>
                    <Button label="Show" icon="pi pi-info-circle" onClick={(e) => setState({visible: true})} />
                    <Button>Baja</Button>
                </ButtonGroup>
            </div>
        </div>
    );
}
